def calculate_players_sent_off(a1, a2, k1, k2, n):
    total_max_yellow_cards = a1 * k1 - a2 * k2
    if n <= a1 * (k1 - 1) + a2 * (k2 - 1):
        min_players_sent_off = 0
    else:
        min_players_sent_off = n - (a1 * (k1 - 1) + a2 * (k2 - 1))
    if n >= total_max_yellow_cards:
        max_players_sent_off = a1 + a2
    elif k1 < k2:
        max_players_sent_off = min(a1, n // k1) + max(0, (n - a1 * k1) // k2)
    else:
        max_players_sent_off = min(a2, n // k2) + max(0, (n - a2 * k2) // k1)
    return (min_players_sent_off, max_players_sent_off)

